const makeInvoiceTable = (data) => {

  let lines = [
    [
      { text: 'Eil. nr.', style: 'tableHeader' },
      { text: 'Paslaugos, prekės pavadinimas', style: 'tableHeader' },
      { text: 'Kiekis', style: 'tableHeader' },
      { text: 'Vnt. kaina, €', style: 'tableHeader' },
      { text: 'Suma, €', style: 'tableHeader' }
    ],
  ];
 
  data.forEach((obj, i) => { 
    let line =  [
      { text: `${i+1}. `, style: 'text' }, //eil nr.
      { text: `${(obj.expense || obj.service) || " "}`, style: 'text' }, // paslauga 
      { text: `${obj.quantity}`, style: 'text' }, // kiekis
      { text: `${obj.price}`, style: 'text' }, // kaina
      { text: `${obj.total}`, style: 'text' }, // suma
    ]; //Note: obj.expense/obj.sevice gali buti "" arba undefined - abi vertes yra falsy, todel reikia truthy vertes palyginimui - " "

    lines.push(line);
  });
  
  return lines;
};


